import React from "react";
import "./App.css";
import MovieList from "./components/MovieList";

function App() {
  const movies = ["titanic", "hgjk"];

  return (
    <div className="App">
      <header className="App-header">
        <h1>Movie Rater</h1>
        <MovieList movies={movies} />
      </header>
    </div>
  );
}

export default App;
